var questions = function questions() {
  $('.product-dropdown__header').click(function () {
    $(this).siblings('.product-dropdown__content').slideToggle(200);
    $(this).toggleClass('product-dropdown__header--opened');
  });
};

var sandwichMenu = function sandwichMenu() {
  $('.sandwich__open-btn').click(function () {
    $('.sandwich__content').addClass('sandwich__content--opened');
    $('.logo').addClass('logo--zindex');
  });
  $('.sandwich__close-btn').click(function () {
    $('.sandwich__content').removeClass('sandwich__content--opened');
    $('.logo').removeClass('logo--zindex');
  });
};

var pattern = function pattern() {
  $('.product-pattern__item').click(function () {
    $(this).addClass('product-pattern__item--active').siblings().removeClass('product-pattern__item--active');
  });
};

var basketMenu = function basketMenu() {
  $('.card-item__add').click(function () {
    $('.basket-menu').addClass('basket-menu--opened');
    $('.basket-menu__wrap').addClass('basket-menu__wrap--opened');
  });
  $('.basket-menu').click(function () {
    $(this).removeClass('basket-menu--opened');
    $('.basket-menu__wrap').removeClass('basket-menu__wrap--opened');
  });
  $('.basket-menu__close').click(function () {
    $(this).removeClass('basket-menu--opened');
    $('.basket-menu__wrap').removeClass('basket-menu__wrap--opened');
  });
  $('.item-basket__close').click(function () {
    $(this).parent().hide();
  });
};

pattern();
